import 'antd/dist/antd.css';

export default function About() {
 return (
   <div className="fullpage1" style={{ backgroundImage: `url(${bg13})` }}>
     <div id='banner'>
         <h1>Atividades desenvolvidas</h1>
         <p>Acreditamos que a educação e alimentação são a base para que nossos alunos tenham as ferramentas necessarias para seu desenvolvimento intelectual e social.</p>       
     </div>
       
       <div className="fp21">
         <div className="cp">
           <h3>Wander Marques</h3>
           <h4>Instrutor de Informatica</h4>
           <p id="info">Engenheiro de Software, atuo na area da informatica e tecnologia no geral a 10 anos.</p>
         </div>


       </div>
   </div>
 );
}
